exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog"),url=`http://www.xqb5.net/${bid.idPrefix()}_${bid}/`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/info-chapters[^>]+>/,"</div>",-1),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};